script: |
  super -f text -I q4550.spq | sort > q4550.out

inputs:
  - name: q4550.spq
    data: |
      SELECT DISTINCT 96 * + COUNT ( * ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 27 BETWEEN NULL AND - ( + - col1 ) + - + 88;
  - name: tab1

outputs:
  - name: q4550.out
    data: |
      288
